import React from "react";
import { Link } from "react-router-dom";
import { FaBeer } from "react-icons/fa";

const Profile = () => {
  return (
    <div className="profile">
      <Link to="/Profile">
        <button type="button" class="btn btn-outline-success">
        <FaBeer></FaBeer>
        </button>
        <FaBeer></FaBeer>

      </Link>
    </div>
  );
};

export default Profile;
